@LesterHoltNBC’s tip: be aware of filter bubbles. 

The social media algorithms feed you info that you’ll interact with. That means you might miss some stuff. Look to a variety of sources to get more context and get out of your filter bubble. 

https://t.co/IHxlEvewgo

text.11:
@camanpour’s tip: remember, there’s a LOT of misinfo online. 

Know that it’s easy for bad actors to spread misinformation. So, stop when a post makes you emotional and fact-check what you see online. 

https://t.co/0iNg0mfX2B

